import React from "react";
import Form from 'react-bootstrap/Form';

function Register() {
  return (
    <>
      <div>
      <TextField
          required
          id="outlined-required"
          label="Required"
          defaultValue="Hello World"
        />
      </div>
    </>
  );
}

export default Register;
